import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Swal from 'sweetalert2';
import 'bootstrap/dist/css/bootstrap.min.css';

const Register = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    primerNombre: "",
    segundoNombre: "",
    primerApellido: "",
    segundoApellido: "",
    identificacion: "",
    email: "",
    fechaNacimiento: "",
    ubicacion: {
      lugar: "",
      ciudad: "",
      departamento: "",
    },
    usuario: {
      login: "",
      password: "",
    },
  });

  const [isHovered, setIsHovered] = useState({ save: false, return: false });

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.includes(".")) {
      const [objectName, field] = name.split(".");
      setFormData((prevData) => ({
        ...prevData,
        [objectName]: {
          ...prevData[objectName],
          [field]: value,
        },
      }));
    } else {
      setFormData((prevData) => ({ ...prevData, [name]: value }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const currentDate = new Date();
    const selectedDate = new Date(formData.fechaNacimiento);
    const year = selectedDate.getFullYear();

    if (selectedDate > currentDate) {
      Swal.fire('Error', 'La fecha de nacimiento no puede ser futura.', 'error');
      return;
    }

    if (year < 1900 || year > 2100) {
      Swal.fire('Error', 'El año de nacimiento debe estar entre 1900 y 2100.', 'error');
      return;
    }

    const dataToSend = {
      ...formData,
      identificacion: parseInt(formData.identificacion),
      usuario: {
        ...formData.usuario,
        id: {
          login: formData.usuario.login,
          persona: null,
        },
      },
    };

    try {
      const response = await fetch("http://localhost:9001/Laboratorio1/persona", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(dataToSend),
      });

      let responseData;
      const contentType = response.headers.get("content-type");
      if (contentType && contentType.includes("application/json")) {
        responseData = await response.json();
      } else {
        responseData = await response.text();
      }

      if (response.ok) {
        Swal.fire('Éxito', typeof responseData === 'object' ? responseData.message : responseData, 'success');
        setTimeout(() => {
          navigate("/");
        }, 2000);
      } else {
        Swal.fire('Error', typeof responseData === 'object' ? responseData.message : responseData, 'error');
      }
    } catch (error) {
      console.error("Error:", error);
      Swal.fire('Error', 'Error en la solicitud.', 'error');
    }
  };

  return (
    <div className="container-fluid" style={{ 
      background: 'linear-gradient(to right, #c1d3ff, #c9b1ff)', 
      minHeight: '100vh', 
      padding: '20px' 
    }}>
      <div className="row justify-content-center">
        <div className="col-md-8">
          <div className="card">
            <div className="card-header">
              <h2>Agregar Persona</h2>
            </div>
            <div className="card-body">
              <form onSubmit={handleSubmit}>
                {/* ... (campos del formulario, similar al código original) ... */}
                
                <div className="d-flex justify-content-between mt-4">
                  <button 
                    type="submit" 
                    className="btn btn-primary"
                    style={{ 
                      transition: 'background-color 0.3s', 
                      backgroundColor: isHovered.save ? '#0056b3' : '#007bff'
                    }} 
                    onMouseEnter={() => setIsHovered(prev => ({ ...prev, save: true }))} 
                    onMouseLeave={() => setIsHovered(prev => ({ ...prev, save: false }))}
                  >
                    Guardar
                  </button>
                  <button 
                    type="button" 
                    className="btn btn-secondary" 
                    onClick={() => navigate("/")}
                    style={{ 
                      transition: 'background-color 0.3s', 
                      backgroundColor: isHovered.return ? '#5a6268' : '#6c757d'
                    }} 
                    onMouseEnter={() => setIsHovered(prev => ({ ...prev, return: true }))} 
                    onMouseLeave={() => setIsHovered(prev => ({ ...prev, return: false }))}
                  >
                    Regresar a Login
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
